## Tooltip

The Tooltip component is a simple component that shows a message when the user hovers over an element.

```jsx
import React, { useContext } from 'react';
import TooltipContext from './TooltipContext';

const Tooltip = ({ children, message }) => {
  const { setTooltip } = useContext(TooltipContext);

  return (
    <div
      onMouseEnter={() => setTooltip(message)}
      onMouseLeave={() => setTooltip(null)}
    >
      {children}
      {tooltip && <div className="tooltip">{tooltip}</div>}
    </div>
  );
};

export default Tooltip;
```

## TooltipContext

The TooltipContext is a React Context that allows the Tooltip component to communicate with other Tooltip components.

```jsx
import React, { createContext, useState } from 'react';

const TooltipContext = createContext();

const TooltipProvider = ({ children }) => {
  const [tooltip, setTooltip] = useState(null);

  return (
    <TooltipContext.Provider value={{ setTooltip }}>
      {children}
      {tooltip && <div className="tooltip">{tooltip}</div>}
    </TooltipContext.Provider>
  );
};

export { TooltipContext, TooltipProvider };
```

## Usage

To use the Tooltip component, you need to wrap your application in the TooltipProvider component.

```jsx
import React from 'react';
import { TooltipProvider } from './TooltipContext';
import Tooltip from './Tooltip';

const App = () => {
  return (
    <TooltipProvider>
      <div>
        <Tooltip message="Hello World">
          <button>Hover over me</button>
        </Tooltip>
        <Tooltip message="Goodbye World">
          <button>Hover over me</button>
        </Tooltip>
      </div>
    </TooltipProvider>
  );
};

export default App;
```

## Conclusion

In this example, we have created a Tooltip component that can be used in different places in our application. We have used React Context to communicate between the Tooltip components and close the previously opened Tooltip when a new Tooltip is opened. This is a simple example, but it can be extended to support more complex use cases.

