const SUBMIT_FORM_MUTATION = gql`
  mutation SubmitForm($input: FormInputType!) {
    createForm(input: $input) {
      id
      field1
      field2
    }
  }
`;

const Form = () => {
  const [formState, setFormState] = useState({ field1: '', field2: '' });
  const [createForm, { data }] = useMutation(SUBMIT_FORM_MUTATION);

  const onSubmit = async (event) => {
    event.preventDefault();
    try {
      const { data } = await createForm({ variables: { input: formState } });
      console.log(data);
    } catch (err) {
      console.error(err);
    }
  };

  return (
    <form onSubmit={onSubmit}>
      <input
        value={formState.field1}
        onChange={(e) =>
          setFormState({ ...formState, field1: e.target.value })
        }
      />
      <input
        value={formState.field2}
        onChange={(e) =>
          setFormState({ ...formState, field2: e.target.value })
        }
      />
      <button type="submit">Submit</button>
    </form>
  );
};

export default Form;
