If you mean that you want to use 0-3 pipes and 0-1 pays in your shell, then you can do that by using the `pipe` and `dup2` system calls in your shell code.

Here is an example of how you might use the `pipe` system call to create a pipe in your shell:
```
int fd[2];
pipe(fd);
```
This will create a pipe and store the file descriptors for the read and write ends of the pipe in the `fd` array. You can then use the `dup2` system call to redirect the standard input or output of a process to the pipe:
```
dup2(fd[0], STDIN_FILENO);
dup2(fd[1], STDOUT_FILENO);
```
This will redirect the standard input of the current process to the read end of the pipe and the standard output of the current process to the write end of the pipe.

You can use this technique to implement pipes in your shell. To implement pays, you can use the `fork` and `exec` system calls to create a new process and execute a command in that process. You can then use the `dup2` system call to redirect the standard input or output of the new process to the pipe.

Here is an example of how you might use the `fork` and `exec` system calls to implement a simple shell that can execute a single command with a pipe:
```
#include <stdio.h>
#include <stdlib.h>
#include <unistd.h>
#include <string.h>
#include <sys/wait.h>

int main()
{
    char *args[3];
    int fd[2];

    pipe(fd);

    args[0] = "ls";
    args[1] = NULL;

    if (fork() == 0) {
        dup2(fd[1], STDOUT_FILENO);
        close(fd[0]);
        execvp(args[0], args);
    }

    args[0] = "wc";
    args[1] = NULL;

    if (fork() == 0) {
        dup2(fd[0], STDIN_FILENO);
        close(fd[1]);
        execvp(args[0], args);
    }

    close(fd[0]);
    close(fd[1]);

    wait(NULL);
    wait(NULL);

    return 0;
